          <a className='btn btn-danger' href='#' ><i className='fas fa-vial'></i>&nbsp;Lab</a><br/><br/>
          <a className='btn btn-danger' href='#' ><i className='fas fa-user-shield'></i>&nbsp;Security</a>   
          <a className='btn btn-danger' href='#' ><i className='fas fa-ambulance'></i>&nbsp;Ambulance</a>
          <i class="fas fa-ambulance"></i> 

      </div>
    )
  }
}
